import Vue from 'vue'
import VueRouter from 'vue-router'
import PetInitial from '../views/PetInitial'
Vue.use(VueRouter)
const routes = [
    {
        path: '/',
        component: PetInitial,
    }
]

const router = new VueRouter({
    routes
})

export default router
